create Procedure Delete_Importacion_CpbtDoc_Esp(@ipc_codemp integer, @ipc_sucid integer, @ipc_tpcid integer, @ipc_numero integer) as    DELETE FROM importacion_cpbtdoc       WHERE ( importacion_cpbtdoc.ipc_codemp = @ipc_codemp ) AND             ( importacion_cpbtdoc.ipc_sucid = @ipc_sucid ) AND             ( importacion_cpbtdoc.ipc_tpcid = @ipc_tpcid ) AND             ( importacion_cpbtdoc.ipc_numero = @ipc_numero )                